import React from 'react'
import './style.css'
import { Link } from 'react-router-dom'





export default function HomePage(props) {





  return (
    <div className='mainDiv'>
     <div> <h2 className='title'>Smart house</h2> </div>
     <div className=''> {props.rooms.map((val) => { 
        return <button className='room' style={{ backgroundColor: val.color }}> <p className='pRoom'>{val.name}</p> </button>
      })}
      </div>

      <div><Link to={'/addroom'}><button className='btn'>+</button></Link> </div>


      {console.log(props.rooms)}






    </div>
  )
}
